import React from 'react';
import { Link } from 'react-router-dom';

function Header({ linkText, linkTo }) {
  return (
    <header className="flex items-center justify-between p-4 bg-white shadow-md">
      <div className="text-xl font-semibold">My App Logo</div>
      <Link to={linkTo} className="text-indigo-600 hover:text-indigo-800">
        {linkText}
      </Link>
    </header>
  );
}

export default Header;
